import { Routes,Route } from "react-router-dom";
import Bookings from "./pages/Bookings";
import Home from "./pages/Home";
import Homehoc from "./HOC/homehoc";
import "./style.css";
function App() {
  return (
    <div className="App">
        <Routes>
          <Route path="/" element={()=>{<Homehoc><Home/></Homehoc>}}></Route>
          <Route path="/bookings" element ={()=>{<Homehoc><Bookings/></Homehoc>}}></Route> 
        </Routes>
    </div>
  );
}

export default App;
